import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import {BrowserRouter as Router, Route} from "react-router-dom"

import Home from "./pages/home"
function App() {
  return (
     <Router>
       <Route extact path="/" component={ Home }/>
     </Router>
  );
}


export default App;
